import '../stylesheets/App.css';
import data from '../data/data.json';

const App = () => {
	const dataOrder = data.sort(function (x, y) {
		if (x.time > y.time) {
			return 1;
		} else if (x.time < y.time) {
			return -1;
		} else {
			return 0;
		}
	});

	const podium = dataOrder.splice(0, 3);

	return console.log(podium);
};

export default App;
